import { useContext } from "react";
import { productContext } from "../MainSection";

function MobileCom() {
    const context = useContext(productContext)
    const filterdProduct = context.productDetail.filter((item) => {
        return item.type === 'mobile'
    })
    // console.log(filterdProduct);
    return (
        <div>
            <h1>Tv List</h1>
            <hr />
            <div className="myCard">
                {filterdProduct.map((item) => {
                    return <div key={item.id} className="card">
                        <img src={item.url} />
                        <h5>productName : {item.productName}</h5>
                        <p>{item.discription}</p>
                        <div>MadeIn :  {item.madeIn}</div>
                    </div>
                })}
            </div>
        </div>
    )
}
export default MobileCom
